        private static string[] namesArray = names_csv.Split(',');
        private static string[] surnamesArray = surnames_csv.Split(",");
        private static string[] jobAreasArray = job_area_csv.Split(",");
        private static string[] jobPositionsArray = job_position_csv.Split(",");


        /// <summary>
        /// This methods generates an employee with random information obtained from the csv strings and arrays declared above.
        /// </summary>
        /// <returns>Employee with random name, surname and job title</returns>
        private static Employee generateRandomEmployee()
        {
            Employee random_employee = new Employee(namesArray[_random.Next(0, namesArray.Length)],
                                                    surnamesArray[_random.Next(0, surnamesArray.Length)],
                                                    jobAreasArray[_random.Next(0, jobAreasArray.Length)]+" "+ jobPositionsArray[_random.Next(0,jobPositionsArray.Length)]);

            return random_employee;
        }

        /// <summary>
        /// Generates a set of n employees with random names, surnames and job titles
        /// </summary>
        /// <param name="n">number of employees required</param>
        /// <returns>Employee[] array of size n containing random employee data</returns>
        public static Employee[] generateRandomEmployees(int n)
        {
            Employee[] random_employees = new Employee[n];
            for(int i = 0; i < n;i++)
            {
                random_employees[i] = generateRandomEmployee();
            }
            return random_employees;
        }

